import './App.css';
import React from 'react';
import Header from "./Content/Header"
import Navbar from "./Content/Navbar"
import Main from "./Content/Main"
import MyTable from './MyTable';
//import PatientList from "./Content/PatientList"

function App() {
  return (

    <div className="App">
     <Header/>
     <Navbar />
     <Main 
         {... MyTable}
      />



    </div>

  );
}

export default App;
